BEGIN;
CREATE SCHEMA IF NOT EXISTS cryptocoven;

CREATE TABLE IF NOT EXISTS cryptocoven.cryptocoven_traits(
   token_id                 SMALLINT PRIMARY KEY,
   archetype_of_power       VARCHAR(90),
   back_item                VARCHAR(90),
   background               VARCHAR(90),
   body_shape               VARCHAR(90),
   earrings                 VARCHAR(90),
   eye_color                VARCHAR(90),
   eye_style                VARCHAR(90),
   eyebrows                 VARCHAR(90),
   face_markings            VARCHAR(90),
   facewear                 VARCHAR(90),
   forehead_jewelry         VARCHAR(90),
   hair_back                VARCHAR(90),
   hair_front               VARCHAR(90),
   hair_middle              VARCHAR(90),
   hair_color               VARCHAR(90),
   hair_topper              VARCHAR(90),
   hat                      VARCHAR(90),
   mask                     VARCHAR(90),
   moon_sign                VARCHAR(90),
   mouth                    VARCHAR(90),
   necklace                 VARCHAR(90),
   outerwear                VARCHAR(90),
   rising_sign              VARCHAR(90),
   skin_tone                VARCHAR(90),
   sun_sign                 VARCHAR(90),
   top                      VARCHAR(90),
   wiles                    SMALLINT,
   will                     SMALLINT,
   wisdom                   SMALLINT,
   wit                      SMALLINT,
   woe                      SMALLINT,
   wonder                   SMALLINT
);


CREATE INDEX IF NOT EXISTS cryptocoven_traits_idx ON cryptocoven.cryptocoven_traits USING BRIN (token_id);

COMMIT;